import { BrowserRouter, Route, Routes, Navigate } from "react-router-dom";
import { SentenceBuilder } from "features/sentence-builder";

function AppRoutes() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Navigate replace to="/sentence-builder" />} />
        <Route path="/sentence-builder" element={<SentenceBuilder />} />
      </Routes>
    </BrowserRouter>
  );
}

export default AppRoutes;
